void audio_playback_mono(int *samples, int n) {
  int i;

  audiop->control = 0x8;  // clear the output FIFOs
  audiop->control = 0x0;  // resume input conversion
  for (i = 0; i < n; i++) {
    // wait till there is space in the output FIFO
    while (audiop->wsrc == 0)
      ;
    audiop->ldata = samples[i];
    audiop->rdata = samples[i];
  }
}

int decToHex7seg(int dec) {
  static const int decToHex[10] = {0x3F,   // 0
                                   0x06,   // 1
                                   0x5B,   // 2
                                   0x4F,   // 3
                                   0x66,   // 4
                                   0x6D,   // 5
                                   0x7D,   // 6
                                   0x07,   // 7
                                   0x7F,   // 8
                                   0x6F};  // 9
  if (dec < 0 || dec > 9) {
    return 0;  // Return 0 or an error code for invalid input
  }
  return decToHex[dec];
}

void tcounter() {
  volatile unsigned int *LED_ptr =
      (volatile unsigned int)LED_BASE;  // Pointer to the LEDs
  if (count == 0) {
    *LED_ptr = counter;  // Update LEDs with the current counter value
    counter++;           // Increment the counter
    if (counter >=
        1024) {  // Reset counter if it exceeds the LEDs' display limit
      counter = 0;
    }
    count = 16;
  }
  count--;
}

void altitude() {
  volatile unsigned int *hex_ptr =
      (volatile unsigned int *)HEX_BASE;  // Correct cast to pointer
  int alt = 0;
  alt = rover_position[1] - 320;
  alt = abs(alt);

  int h_dig = alt / 100;
  int t_dig = (alt % 100) / 10;
  int o_dig = (alt % 100) % 10;

  unsigned int hex_value = (decToHex7seg(h_dig) << 16) |
                           (decToHex7seg(t_dig) << 8) | decToHex7seg(o_dig);
  *hex_ptr = hex_value;
}

