// To find orientation of ordered triplet (p, q, r).
// The function returns following values
// 0 --> p, q, and r are colinear
// 1 --> Clockwise
// 2 --> Counterclockwise
int orientation(Point p, Point q, Point r) {
  int val = (q.y - p.y) * (r.x - q.x) - (q.x - p.x) * (r.y - q.y);
  if (val == 0) return 0;    // Colinear
  return (val > 0) ? 1 : 2;  // Clock or counterclockwise
}

// Given three colinear points p, q, r, the function checks if
// point q lies on line segment 'pr'
bool onSegment(Point p, Point q, Point r) {
  if (q.x <= max(p.x, r.x) && q.x >= min(p.x, r.x) && q.y <= max(p.y, r.y) &&
      q.y >= min(p.y, r.y))
    return true;
  return false;
}

// The main function that returns true if line segment 'p1q1'
// and 'p2q2' intersect.
bool doIntersect(Point p1, Point q1, Point p2, Point q2) {
  // Find the four orientations needed for the general and special cases
  int a1 = orientation(p1, q1, p2);
  int a2 = orientation(p1, q1, q2);
  int a3 = orientation(p2, q2, p1);
  int a4 = orientation(p2, q2, q1);

  // General case
  if (a1 != a2 && a3 != a4) return true;

  // Special Cases
  // p1, q1 and p2 are colinear and p2 lies on segment p1q1
  if (a1 == 0 && onSegment(p1, p2, q1)) return true;
  // p1, q1 and q2 are colinear and q2 lies on segment p1q1
  if (a2 == 0 && onSegment(p1, q2, q1)) return true;
  // p2, q2 and p1 are colinear and p1 lies on segment p2q2
  if (a3 == 0 && onSegment(p2, p1, q2)) return true;
  // p2, q2 and q1 are colinear and q1 lies on segment p2q2
  if (a4 == 0 && onSegment(p2, q1, q2)) return true;
  return false;  // Doesn't fall into any of the above cases
}

int keyboard() {
  volatile int *PS2_ptr = (int *)0xFF200100;  // PS/2 port address
  int PS2_data, RVALID;

  PS2_data = *(PS2_ptr);         // read the Data register in the PS/2 port
  RVALID = (PS2_data & 0x8000);  // extract the RVALID field

  if (RVALID != 0) {
    byte1 = byte2;
    byte2 = byte3;
    byte3 = PS2_data & 0xFF;
    if (byte2 != 0xf0) {
      switch (byte3) {
        case 0x75:
          return 1;
        case 0x6B:
          return 2;
        case 0x74:
          return 3;
        case 0x29:
          return 4;
        case 0x72:
          return 5;
      }
    }
  }
  return -1;
}

int keys() {
  volatile int *KEY_ptr = (int *)0xFF200050;
  int key_check = *(KEY_ptr + 3);

  if ((key_check & 0xff) > 0) {
    *(KEY_ptr + 3) = key_check;
    return 1;
  }
  return -1;
}

void swap(int *a, int *b) {
  int temp = *a;
  *a = *b;
  *b = temp;
}

void write_char(int x, int y, char c) {
  // VGA character buffer
  volatile char *character_buffer = (char *)(0x09000000 + (y << 7) + x);
  *character_buffer = c;
}

void typeNextLevelStart(char *str) {
  int x0 = 2;
  int y0 = 30;
  volatile int *pixel_ctrl_ptr = (int *)0xFF203020;
  bool check = false;

  wait_for_vsync();  // swap front and back buffers on VGA vertical sync
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

  for (int pos = 0; pos < strlen(str); pos++) {
    write_char(x0 + pos, y0, str[pos]);
  }

  wait_for_vsync();  // swap front and back buffers on VGA vertical sync
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);  // new back buffer

  while (1) {
    int inp_clear = keyboard();
    if (inp_clear == 4) {
      printf("Space\n");
      check = true;
      break;
    }
  }

  if (check == true) {
    for (int pos = 0; pos < strlen(str); pos++) {
      write_char(x0 + pos, y0, 0);
    }
  }
}

