int scaleValue(double value) {
  // Define the old range
  double oldMin = -2;
  double oldMax = 2;

  // Define the new range
  double newMin = -9;
  double newMax = 9;

  // Apply the scaling formula
  double newValue =
      ((value - oldMin) / (oldMax - oldMin)) * (newMax - newMin) + newMin;

  return (int)myRound(newValue);
}

